def determine_winner_and_move(q: int) -> tuple:
    if q != 1:
        return (1, 0)
    arr = []
    p = q
    while p % 2 == 0:
        arr.append(2)
        p = p // 2
    x = int(p ** 0.5) + 1
    for i in range(3, x, 2):
        while p % i == 0:
            arr.append(i)
            p = p // i
    if p > 2:
        arr.append(p)
    if len(arr) == 1:
        return (1, 0)
    elif len(arr) == 2:
        return (2, 0)
    else:
        first_move = arr[0] * arr[1]
        return (1, first_move)

